@app.route('/<teamname>/display_salary_cap', methods=['GET'])
def display_salary_cap(teamname):
    insert_salary_cap()
    conn = get_db_connection()
    cursor = conn.cursor()

    try:

        cursor.execute("SELECT TeamID FROM Teams WHERE TeamName = ?", (teamname,))
        team = cursor.fetchone()
        if not team:
            return jsonify({"error": "Team not found"}), 404

        team_id = team['TeamID']

        cursor.execute("SELECT SalaryCapLimit FROM SalaryCap ORDER BY SeasonYear DESC LIMIT 1")
        salary_cap = cursor.fetchone()
        if not salary_cap:
            return jsonify({"error": "Salary cap data not found"}), 404

        salary_cap_limit = salary_cap['SalaryCapLimit']

        cursor.execute("""
            SELECT SUM(c.Salary) AS TotalSalary
            FROM Players p
            JOIN Contracts c ON p.PlayerID = c.PlayerID
            WHERE p.TeamID = ?
        """, (team_id,))
        total_salary_result = cursor.fetchone()
        total_salary = total_salary_result['TotalSalary'] if total_salary_result['TotalSalary'] else 0

        data = {
            "team_name": teamname,
            "total_salary": total_salary,
            "salary_cap_limit": salary_cap_limit,
            "under_salary_cap": total_salary <= salary_cap_limit
        }

        return jsonify(data)
    except Exception as e:
        return jsonify({"error": str(e)}), 500
    finally:
        conn.close()
