@app.route('/insert_salary_cap', methods=['POST'])
def insert_salary_cap():
    conn = get_db_connection()
    cursor = conn.cursor()

    try:
        cursor.execute("SELECT * FROM SalaryCap WHERE SeasonYear = 2024")
        existing = cursor.fetchone()
        if existing:
            return jsonify({"error": "Salary cap for 2024 already exists"}), 409

        cursor.execute("INSERT INTO SalaryCap (SeasonYear, SalaryCapLimit) VALUES (?, ?)", 
                       (2024, 255.4 * 1000000))  
        conn.commit()
        return jsonify({"message": "Salary cap for 2024 inserted successfully"}), 201
    except Exception as e:
        conn.rollback()
        return jsonify({"error": str(e)}), 500
    finally:
        conn.close()
