@app.route('/display_transactions', methods=['GET'])
def display_transactions():
    conn = get_db_connection()
    cursor = conn.cursor()

    try:
        cursor.execute('''
            SELECT 
                p.Name AS PlayerName, 
                t.TransactionType, 
                t.TransactionDate
            FROM Transactions t
            JOIN Players p ON t.PlayerID = p.PlayerID
            ORDER BY t.TransactionDate DESC
        ''')
        transactions = cursor.fetchall()
        transactions_list = [dict(transaction) for transaction in transactions]

        return jsonify(transactions_list)
    except Exception as e:
        return jsonify({"error": str(e)}), 500
    finally:
        conn.close()
#drop players to free agency
@app.route('/<player_name>/drop_to_free_agency', methods=['POST'])
def drop_to_free_agency(player_name):
    conn = get_db_connection()
    cursor = conn.cursor()

    cursor.execute("SELECT TeamID FROM Teams WHERE TeamName = 'Free Agency'")
    free_agency_team = cursor.fetchone()
    if not free_agency_team:
        return jsonify({"error": "Free Agency team not found"}), 404

    try:
        cursor.execute("UPDATE Players SET TeamID = ? WHERE Name = ?",
                       (free_agency_team['TeamID'], player_name))
        cursor.execute("UPDATE Contracts SET Salary = 0 WHERE PlayerID IN (SELECT PlayerID FROM Players WHERE Name = ?)",
                       (player_name,))
        cursor.execute("SELECT PlayerID FROM Players WHERE Name = ?", (player_name,))
        player_id = cursor.fetchone()[0]
        cursor.execute("INSERT INTO Transactions (PlayerID, TransactionType, TransactionDate) VALUES (?, ?, DATE('now'))", 
                       (player_id, 'Dropped to Free Agency'))
        conn.commit()
    except Exception as e:
        conn.rollback()
        return jsonify({"error": str(e)}), 500
    finally:
        conn.close()

    return jsonify({"message": f"{player_name} dropped to Free Agency and salary set to $0"}), 200

