@app.route('/load_contracts', methods=['POST'])
def load_contracts():
    try:
        conn = sqlite3.connect('nfl_salary_cap.db')
        cursor = conn.cursor()
        cursor.execute("SELECT COUNT(*) FROM Contracts")
        if cursor.fetchone()[0] != 0:
            return jsonify({"message": "Contracts table is not empty. No data loaded."}), 200
       
        df = pd.read_excel('NFL_Salary_Data.xlsx')



        for _, contract in df.iterrows():
            cursor.execute("SELECT PlayerID FROM Players WHERE Name = ?", (contract['Name'],))
            player_id_result = cursor.fetchone()
            
            player_id = player_id_result[0]

            cursor.execute("INSERT INTO Contracts (PlayerID, Salary) VALUES (?, ?)",
                               (player_id, contract['Salary']))
        conn.commit()
       
                
        return jsonify({"message": "Contracts loaded successfully"}), 201
       
    except Exception as e:
        print("Error:", e)
        return jsonify({"error": str(e)}), 500
#transfers players to teams
@app.route('/transfer_player/<int:player_id>/<team_name>/<int:salary>', methods=['POST'])
def transfer_player(player_id, team_name, salary):
    conn = get_db_connection()
    cursor = conn.cursor()

    try:

        cursor.execute("SELECT TeamID FROM Teams WHERE TeamName = ?", (team_name,))
        team = cursor.fetchone()
        if not team:
            return jsonify({"error": "Team not found"}), 404

        team_id = team['TeamID']

        cursor.execute("UPDATE Players SET TeamID = ? WHERE PlayerID = ?", (team_id, player_id))

        cursor.execute("UPDATE Contracts SET Salary = ? WHERE PlayerID = ?", (salary, player_id))
        cursor.execute("INSERT INTO Transactions (PlayerID, TransactionType, TransactionDate) VALUES (?, ?, DATE('now'))", 
                       (player_id, f'Transferred to {team_name}'))

        conn.commit()
        return jsonify({"message": f"Player {player_id} transferred to {team_name} and salary updated to ${salary} successfully"}), 200
    except Exception as e:
        conn.rollback()
        return jsonify({"error": str(e)}), 500
    finally:
        conn.close()
#display information by team name
@app.route('/teams/<team_name>', methods=['GET'])
def get_team_info(team_name):

    conn = sqlite3.connect('nfl_salary_cap.db')
    conn.row_factory = sqlite3.Row 
    cur = conn.cursor()

    cur.execute('''
        SELECT t.TeamID, t.TeamName, t.TeamLocation, t.TeamOwner, t.Logo,
               p.PlayerID, p.Name as PlayerName, p.Position, c.Salary
        FROM Teams t
        LEFT JOIN Players p ON t.TeamID = p.TeamID
        LEFT JOIN Contracts c ON p.PlayerID = c.PlayerID
        WHERE t.TeamName = ?
    ''', (team_name,))

    results = cur.fetchall()

    if not results:
        return jsonify({'error': 'Team not found'}), 404

    team_info = {
        'TeamID': results[0]['TeamID'],
        'TeamName': results[0]['TeamName'],
        'TeamLocation': results[0]['TeamLocation'],
        'TeamOwner': results[0]['TeamOwner'],
        'Logo': results[0]['Logo'],
        'Players': []
    }


    for row in results:
        if row['PlayerName']:  
            team_info['Players'].append({
                'PlayerID': row['PlayerID'],
                'Name': row['PlayerName'],
                'Position': row['Position'],
                'Salary': row['Salary']
            })

    conn.close()

    return jsonify(team_info)
